class Solution:
    def findTheDifference(self, s: str, t: str) -> str:
        
        sCount = {}
        tCount ={}
        
        # count letter frequency in s
        for i in range(len(s)):
            if s[i] in sCount:
                sCount[s[i]] += 1
            else:
                sCount[str(s[i])] =1
               
        # count letter frequency in t
        for i in range(len(t)):
            if t[i] in tCount:
                tCount[t[i]] += 1
            else:
                tCount[str(t[i])] =1
                
        # find the difference 
        # case 1: key doesn't exist in another
        # case 2: count for letter doesn't match
        
        for t in tCount:
            if t not in sCount:
                return t
            else:
                if sCount[t] != tCount[t]:
                    return t
        
